function to_key(n_workers, n_gold_q, agg, features, model_freq, use_ta, use_early_stop) {

    if (use_ta) {
        var sampler = "push_greedy";
    }
    else {
        var sampler = "pull_random";
    }

    var n_crowds_experts = n_workers_to_crowds_and_experts[n_workers];
    if (agg == "Online DS model"){
        var key = `imagenet_split_4-${agg_dict[agg]}-${sampler}-n_crowds=${n_crowds_experts[0]}-n_experts=${n_crowds_experts[1]}-n_gold_q=${n_gold_q}`;
    }
    else
    {
        console.log(agg);
        var key = `imagenet_split_4-${name_to_features[features]}-${agg_dict[agg]}-${sampler}-hit_size=${model_freq_to_hit_size[model_freq]}-n_crowds=${n_crowds_experts[0]}-n_experts=${n_crowds_experts[1]}-n_gold_q=${n_gold_q}`;    
    }
    
    if (use_early_stop) {
        key = `${key}-early_stop`;
    }
    return key
}

